function postwith(to, p) {
        var searchForm = document.createElement("form");
        searchForm.method = "get";
        searchForm.action = to;
        for (var k in p) {
            var searchFormInput = document.createElement("input");
            searchFormInput.setAttribute("name", k);
            searchFormInput.setAttribute("value", p[k]);
            searchForm.appendChild(searchFormInput);
        }
        document.body.appendChild(searchForm);
        searchForm.submit();
        document.body.removeChild(searchForm);
    }
